  return (
    <>
        <div>
            <form>
                <label>Add notes</label>
                <input 
                    type="text" 
                    placeholder="First Name"
                    value={first_name}
                    onChange={(e) => setFirst_name(e.target.value)}>
                </input><br/>
            </form>
        </div>
    </>
  )
}
